import Strategie from "./Strategie";
import Header from "./Header";
import Vulnerability from "./Vulnerability";
import Fasi from "./Fasi";
import Articoli from "./Articoli";
import MCV from "./MCV";
import UserCard from "./User_Card";

function Sidebar() {
  return (
    <div className="flex flex-col items-center fixed top-0 left-0 m-4 space-y-4">
      <Header></Header>
      <div className="mt-20 space-y-2 flex flex-col items-center">
        <Strategie></Strategie>
        <Vulnerability></Vulnerability>
        <Fasi></Fasi>
        <Articoli></Articoli>
        <MCV></MCV>
        <UserCard></UserCard>
      </div>
    </div>
  );
}

export default Sidebar;
